import React, { useContext } from 'react';
import { Navbar, Nav, Button, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { SHOP_ROUTE } from '../utils/consts';
import { Context } from '../index';

const NavBar = () => {
    const { user } = useContext(Context);
    return (
        <Navbar bg="dark" variant="dark" style={{ minHeight: 56 }}>
            <Container fluid className="d-flex justify-content-between align-items-center px-3">
                <NavLink
                    to={SHOP_ROUTE}
                    style={{
                        color: 'white',
                        textDecoration: 'none',
                        fontSize: 20,
                        fontWeight: 500,
                        padding: '6px 0'
                    }}
                >
                    ElecShopic
                </NavLink>
                {user.isAuth ? (
                    <Nav className="d-flex align-items-center" style={{ color: 'white' }}>
                        <Button variant="outline-light" className="me-2">Админ панель</Button>
                        <Button variant="outline-light">Выйти</Button>
                    </Nav>
                ) : (
                    <Nav className="d-flex align-items-center" style={{ color: 'white' }}>
                        <Button variant="outline-light">Авторизация</Button>
                    </Nav>
                )}
            </Container>
        </Navbar>
    );
};

export default NavBar;
